import React from 'react'

const FAQ = () => {
    return (
        <>
            <div className='bg-black'>

                <h1 className='text-5xl text-white font-bold    text-center '>Frequently Asked Questions</h1>
                <div>FAQ</div>
            </div>
        </>
    )
}

export default FAQ
